import React, { Component } from "react";


class Paginator extends Component {

  render() {

    var liList = [];
    liList.push(<li className="page-item disabled">
    <a className="page-link" href="#" aria-label="Previous">
        <span aria-hidden="true">&laquo;</span>
        <span className="sr-only">Previous</span>
      </a>
    </li>);
    for (var i=this.props.startIdx; i <= this.props.endIdx; i ++){
      liList.push(<li className="page-item"><a className="page-link" href="#">{i}</a></li>);
    }
    liList.push(<li className="page-item">
    <a className="page-link" href="#" aria-label="Next">
      <span aria-hidden="true">&raquo;</span>
      <span className="sr-only">Next</span>
    </a>
    </li>);

    return (
      <nav aria-label="Page navigation example" 
      style={{height:"40px", border:"0px dashed red"}}>
      <ul class="pagination justify-content-end"
        style={{border:"0px dashed red"}}>
        {liList}
      </ul>
    </nav>
  );


  }
}

export default Paginator;
